import React from "react";

let Footer = function(){
    let styleIN = {
        padding:'10px',
        margin:'5px'
    }
    return(
        <form>
            <input class="form-control" style={styleIN} type="number" placeholder="ID" aria-label="Disabled input example" />
            <input class="form-control" style={styleIN} type="text" placeholder="Name" aria-label="Disabled input example" />
            <input class="form-control" style={styleIN} type="number" placeholder="Age" aria-label="Disabled input example" />
            <input class="form-control" style={styleIN} type="number" placeholder="Salary" aria-label="Disabled input example" />
            <input class="form-control btn btn-outline-danger" style={styleIN} type="submit" placeholder="add" aria-label="Disabled input example"/>
        </form>
    );
}

export default Footer;
